const name = {
  type: "string",
};

export const organisationTable = [
  {
    field: "initials",
    headerName: "ðŸ¢",
    headerAlign: "center",
    width: 60,
    editable: true,
    renderCell: (params) => {
      return <Avatar>{params.value}</Avatar>;
    },
  },
  {
    field: "name",
    headerName: "Business Name",
    editable: true,
    width: 250,
  },
  {
    field: "city",
    headerName: "City",
    width: 150,
    editable: true,
  },
  {
    field: "gstin",
    headerName: "GSTIN",
    width: 180,
    editable: true,
  },
];

export const vehicleTable = [
  {
    field: "initials",
    headerName: "ðŸšš",
    headerAlign: "center",
    sx: {
      '& div[data-rowIndex][role="row"]:nth-of-type(5n-4)': {
        color: "blue",
        fontSize: 18,
      },
    },
    width: 60,
    editable: true,
    renderCell: (params) => {
      return <Avatar>{params.value}</Avatar>;
    },
  },
  {
    field: "vehicleNumber",
    headerName: "Vehicle Number",
    width: 250,
  },
  {
    field: "make",
    headerName: "Make",
    width: 150,
  },
  {
    field: "model",
    headerName: "Model",
    width: 180,
  },
];
